def findPath(start: ID, end: ID): Option[List[ID]] = {
    val queue = new mutable.Queue[(ID, List[ID])]
    queue.enqueue((start, List(start)))
    val visited = mutable.Set[ID]()

    while (queue.nonEmpty) {
        val (node, path) = queue.dequeue()

        if (node == end) {
            return Some(path)
        }

        visited.add(node)

        val neighbors = List(nbr(mid()))

        for (neighbor <- neighbors) {
            if (!visited.contains(neighbor)) {
                val newPath = path ++ List(neighbor)
                queue.enqueue((neighbor, newPath))
            }
        }
    }

    None
}

