  def main(): Unit = {
    val graph = List(List(1, 2), List(0, 2), List(0, 1, 3), List(2))
    val startNode = 0
    val endNode = 3

    val distances = Array.ofDim[Int](graph.length)(_ => 0)
    val visited = Array.ofDim[Boolean](graph.length)(_ => false)

    val queue = Queue[Int]()
    distances(startNode) = 0
    queue.enqueue(startNode)
    visited(startNode) = true

    while (!queue.isEmpty) {
      val u = queue.dequeue()

      for (v <- graph(u)) {
        if (!visited(v)) {
          distances(v) = distances(u) + 1
          visited(v) = true
          queue.enqueue(v)
        }
      }
    }

    println(distances(endNode))
  }

  class Queue[T] {
    private var list: List[T] = List[T]()

    def enqueue(item: T): Unit = {
      list = list :+ item
    }

    def dequeue(): T = {
      if (list.isEmpty) {
        error("Queue is empty")
      }
      list match {
        case List() => error("Queue is empty")
        case head :: tail => head
      }
    }

    def isEmpty(): Boolean = {
      list.isEmpty
    }
  }
}

