    )

    def minDistance(startNode: Int, endNode: Int, graph: List[List[Int]]): Int = {
      val dist = graph.map(_.map(_.toBigInt).toArray).map(_.update(startNode, 0.toBigInt)).toArray
      val visited = Array.ofSize(graph.length).map(_.toBoolean).update(startNode, true)

      def dfs(node: Int, endNode: Int, dist: Array[BigInt], visited: Array[Boolean]): Int = {
        if (node == endNode) {
          return dist(node)
