        val neighbors = graph(node)
        val minDistance = neighbors.map(neighbor => {
          if (!visited(neighbor)) {
            dfs(neighbor, endNode, dist, visited.update(neighbor, true))
          } else {
            dist(node)
          }
        }).min

        if (minDistance == BigInt.MAX) {
          BigInt.MAX
        } else {
          minDistance
        }
      }

      dfs(startNode, endNode, dist, visited)
    }

