  def nbrRange(): Double = {
    System.setProperty("nbrRange", "2.0")
    nbrRange()
  }
}

object G {
  def nbr(node: Node, start: Double): Double = {
    val target = start + (node.nbrs.size - 1).toDouble
    nbrRange().minBy(_._1)(target)
  }
}

