import scala.collection.mutable

object Main {
  // Define the sense construct
  def sense[A](sensor: String): A = sense[float]("temperature")

  // Define the nbr construct
  def nbr(tensor: Double): Double = nbrRange() + nbr(sense[float]("temperature"))

  // Define the G construct
  def G[V](source: Boolean, field: V, acc: V => V, metric: () => Double): V = Gsource[source](field, acc, metric)

  // Define the C construct
  def C[V](maxInfluence: Double, metric: () => Double): Boolean = Csource[maxInfluence](metric)

  // Define the S construct
  def S[V](maxInfluence: Double, metric: () => Double): Boolean = Ssource[maxInfluence](metric)

  // Define the Gsource and Csource functions for the G and C constructs
  def Gsource(source: Boolean, field: Double, acc: Double => Double, metric: () => Double): Double = {
    if (source) {
      metric()
    } else {
      (acc + field) / 2
    }
  }

  def Csource(maxInfluence: Double, metric: () => Double): Boolean = {
    val loc = nbr(sense[float]("temperature"))
    metric() > loc + 2
  }

  // Define the main function
  def main(): Double = {
    val t = sense[float]("temperature")
    val alarm = nbr(t) > 30
    G(false, t, _ => true, (_: Double) => t + 2) if (C(2, _ => t > 30)) alarm
  }
}


